import './Header.css';




function Header() {

    const nav = 'Home';


    return (

        <div >
            <ul >
                <li>{navigator}</li>
                <li><a href="news.asp">News</a></li>
                <li><a href="contact.asp">Contact</a></li>
                <li><a href="about.asp">About</a></li>
            </ul>
        </div>


    );




}

export default Header;
